import React from 'react';
import { useNavigate } from 'react-router-dom';
import './NavigationBar.css';

const NavigationBar = () => {
  const navigate = useNavigate();
  const isLoggedIn = !!localStorage.getItem("userId"); // check if user logged in
  const userImage = "https://i.pravatar.cc/40"; // sample profile pic

  const handleGetStarted = () => navigate("/register");
  const handleLoginOnLanding = () => navigate("/login");
  const handleDashboard = () => navigate("/dashboard");
  const handleProfile = () => navigate("/profile");

  return (
    <div className='nav'>
      <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">Advanced To Do</div>
          <li className="active">HOME</li>
          <li onClick={handleDashboard}>DASHBOARD</li>
          <li>USERS</li>
          <li>TASKS</li>
        </ul>

        {/* Right side: conditionally show buttons or profile */}
        <div className="nav-right">
          {!isLoggedIn ? (
            <>
              <button className="loginn-btn" onClick={handleLoginOnLanding}>LOGIN</button>
              <button className="signup-btn" onClick={handleGetStarted}>SIGNUP</button>
            </>
          ) : (
            <img
              src={userImage}
              alt="Profile"
              className="profile-avatar"
              onClick={handleProfile}
              title="Go to Profile"
            />
          )}
        </div>
      </nav>
    </div>
  );
};

export default NavigationBar;
